const Header =()=>{
    return(
        <div>
            <Link href="/"><a>Home</a></Link>
            <Link href="/about"><a>About</a></Link>

            <style jsx>{`
            a{
                margin: 2px;
                padding: 5px;
                border
                
            }
            `}
            </style>
        </div>
    )
}
export default Header;
